INSERT INTO `xr_garan24_paymenttype` VALUES (0,'garan24','Оплата после доставки','Сумма оплаты будет списана с Вашей карты автоматически через 14 дней после получения заказа. Чтобы использовать этот способ оплаты, введите реквизиты своей банковской карты на следующей странице. Для проверки карты на ней будет заблокирован 1 рубль, который сразу же будет возвращен.'),(1,'ondelivery','Оплата при получении','Вы оплатите заказ картой в момент получения курьеру или сотруднику пункта выдачи заказов.'),(2,'online','Оплата картой онлайн','На следующем экране Вам нужно будет указать реквизиты своей банковской карты, после чего с нее будет списана полная стоимость заказа.'),(3,'cash','Оплата наличными при получении','Вы оплатите заказ наличными в момент получения курьеру или сотруднику пункта выдачи заказов.'),(4,'garan24.ondelivery','Оплата при доставке','Сумма оплаты будет списана с Вашей карты автоматически  после получения заказа. Чтобы использовать этот способ оплаты, введите реквизиты своей банковской карты на следующей странице. Для проверки карты на ней будет заблокирован 1 рубль, который сразу же будет возвращен.');
